actionConfiguration.body:
()=>{
		GetGSheetContent_ProductAlias.run(
			//success
			() => {
				let array_payload=[];		
				let APIdata = [];
				APIdata = GetGSheetContent_ProductAlias.data.values;
				for (let i=1;i<APIdata.length;i++){
					array_payload.push({
						"alias": APIdata[i][0],
						"productId": APIdata[i][1],
						"providerId": ((APIdata[i][2]==null||APIdata[i][2]=="")?null:APIdata[i][2]),
						"sourceId": ((APIdata[i][3]==null||APIdata[i][3]=="")?null:APIdata[i][3])
					})						
				}
				storeValue("Key_Alias_UserPayload", array_payload);
			},
			//fail
			() => {showAlert("Something went wrong - Data not inserted")}			
		)
	}

